INSERT INTO tourist_attractions (name, image_url, y, x, summary, address)
VALUES ('감천문화마을',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/05916b92-23e5-4d05-b440-22093e2a24a9%E1%84%80%E1%85%A1%E1%86%B7%E1%84%8E%E1%85%A5%E1%86%AB%E1%84%86%E1%85%AE%E1%86%AB%E1%84%92%E1%85%AA%E1%84%86%E1%85%A1%E1%84%8B%E1%85%B3%E1%86%AF.jpeg',
        35.0975, 129.0105,
        '감천문화마을은 부산의 대표적인 관광지로, 다양한 색깔의 집들이 모여 있는 독특한 경관이 특징입니다. 이곳은 예술가들의 작품과 골목길, 벽화들이 어우러져 문화적 체험과 함께 아름다운 사진 촬영 장소로 인기가 높습니다.', '부산 사하구 감내2로 203 감천문화마을안내센터'),
       ('흰여울문화마을',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/230f2b72-d4b7-458d-8081-d2b3d04cb205%E1%84%92%E1%85%B4%E1%86%AB%E1%84%8B%E1%85%A7%E1%84%8B%E1%85%AE%E1%86%AF%E1%84%86%E1%85%AE%E1%86%AB%E1%84%92%E1%85%AA%E1%84%86%E1%85%A1%E1%84%8B%E1%85%B3%E1%86%AF.jpeg',
        35.0814, 129.0349,
        '흰여울문화마을은 바다와 가까운 절벽 위에 위치해 있으며, 전통적인 주택과 현대적인 아트워크가 조화를 이루는 장소입니다. 지역 예술가들의 작품이 전시되어 있고, 해안선을 따라 산책할 수 있는 경로가 마련되어 있어 여유로운 산책을 즐기기 좋습니다.', '부산 영도구 영선동4가 605-3'),
       ('해운대해수욕장',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/e755b897-7cd5-4aae-b76d-fcdf57a38a99%E1%84%92%E1%85%A2%E1%84%8B%E1%85%AE%E1%86%AB%E1%84%83%E1%85%A2%E1%84%92%E1%85%A2%E1%84%89%E1%85%AE%E1%84%8B%E1%85%AD%E1%86%A8%E1%84%8C%E1%85%A1%E1%86%BC.jpeg',
        35.1587, 129.1604,
        '해운대해수욕장은 부산을 대표하는 해수욕장으로, 넓은 백사장과 맑은 바다가 매력적입니다. 여름철에는 수많은 관광객이 방문하며, 다양한 해양 스포츠와 이벤트가 열려 활기찬 분위기를 만끽할 수 있습니다.', '부산 해운대구 우동'),
       ('광안리해수욕장',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/8bdd8211-f1f8-4714-b41c-b8e59a4a0e64%E1%84%80%E1%85%AA%E1%86%BC%E1%84%8B%E1%85%A1%E1%86%AB%E1%84%85%E1%85%B5%E1%84%92%E1%85%A2%E1%84%89%E1%85%AE%E1%84%8B%E1%85%AD%E1%86%A8%E1%84%8C%E1%85%A1%E1%86%BC.jpeg',
        35.1539, 129.1184,
        '광안리해수욕장은 해안선이 아름답고 밤에는 광안대교의 조명이 환상적인 풍경을 제공합니다. 이곳은 젊은 층에게 인기가 높으며, 바다 앞에 위치한 카페와 레스토랑에서 즐길 수 있는 야경이 매력적입니다.', '부산 수영구 광안해변로 219'),
       ('태종대 유원지',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/e8979ca2-7958-4340-b4a3-68f785a7382c%E1%84%90%E1%85%A2%E1%84%8C%E1%85%A9%E1%86%BC%E1%84%83%E1%85%A2%20%E1%84%8B%E1%85%B2%E1%84%8B%E1%85%AF%E1%86%AB%E1%84%8C%E1%85%B5.jpeg',
        35.0512, 129.0875,
        '태종대 유원지는 해안 절벽과 아름다운 경치로 유명하며, 태종대 등대가 위치해 있습니다. 이곳에서는 바다를 바라보며 산책할 수 있는 코스가 마련되어 있고, 유람선 투어를 통해 해양 생태계를 경험할 수도 있습니다.', '부산 영도구 전망로 257'),
       ('용두산공원과 부산타워',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/05e3551b-3793-4aff-b1cf-dbecf78283be%E1%84%8B%E1%85%AD%E1%86%BC%E1%84%83%E1%85%AE%E1%84%89%E1%85%A1%E1%86%AB%E1%84%80%E1%85%A9%E1%86%BC%E1%84%8B%E1%85%AF%E1%86%AB%E1%84%80%E1%85%AA%20%E1%84%87%E1%85%AE%E1%84%89%E1%85%A1%E1%86%AB%E1%84%90%E1%85%A1%E1%84%8B%E1%85%AF.JPG',
        35.1005, 129.0320,
        '용두산공원은 부산의 중심에 위치한 공원으로, 부산타워가 있어 전망을 즐기기 좋은 곳입니다. 공원 내에는 아름다운 꽃과 나무들이 조성되어 있으며, 부산의 전경을 한눈에 감상할 수 있습니다.', '부산 중구 광복동2가'),
       ('송도 해상 케이블카',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/356be086-ac60-4519-8a83-8aaa2716c4ce%E1%84%89%E1%85%A9%E1%86%BC%E1%84%83%E1%85%A9%20%E1%84%92%E1%85%A2%E1%84%89%E1%85%A1%E1%86%BC%20%E1%84%8F%E1%85%A6%E1%84%8B%E1%85%B5%E1%84%87%E1%85%B3%E1%86%AF%E1%84%8F%E1%85%A1.jpeg',
        35.0771, 129.0172,
        '송도 해상 케이블카는 송도 해수욕장과 미포를 연결하며, 바다 위를 가로지르는 독특한 경험을 제공합니다. 케이블카를 타고 해안선을 따라 이동하며 환상적인 바다 경관을 즐길 수 있습니다.', '부산 서구 송도해변로 171'),
       ('BIFF 광장과 국제시장',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/28ea4c65-6269-4938-bf0c-25cfccf0a231BIFF%20%E1%84%80%E1%85%AA%E1%86%BC%E1%84%8C%E1%85%A1%E1%86%BC%E1%84%80%E1%85%AA%20%E1%84%80%E1%85%AE%E1%86%A8%E1%84%8C%E1%85%A6%E1%84%89%E1%85%B5%E1%84%8C%E1%85%A1%E1%86%BC.jpg',
        35.0988, 129.0363,
        'BIFF 광장은 부산국제영화제가 열리는 장소로, 영화 관련 행사와 다양한 문화행사가 진행됩니다. 근처 국제시장에서는 신선한 해산물과 전통 먹거리를 맛볼 수 있어 많은 관광객들이 찾는 명소입니다.', '부산 중구 구덕로 44'),
       ('자갈치시장',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/ab22568e-87c8-4481-a90e-b35abdfd2b77%E1%84%8C%E1%85%A1%E1%84%80%E1%85%A1%E1%86%AF%E1%84%8E%E1%85%B5%E1%84%89%E1%85%B5%E1%84%8C%E1%85%A1%E1%86%BC.jpg',
        35.0973, 129.0364,
        '자갈치시장은 부산의 대표적인 수산물 시장으로, 신선한 해산물을 직접 구입하고 맛볼 수 있는 곳입니다. 다양한 해산물이 진열되어 있어 관광객들에게는 생동감 넘치는 시장의 풍경이 매력적입니다.', '부산 중구 자갈치해안로 52 자갈치시장'),
       ('해동용궁사',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/0294dc53-d69c-4d13-9cf2-edfc0cf04827%E1%84%92%E1%85%A2%E1%84%83%E1%85%A9%E1%86%BC%E1%84%8B%E1%85%AD%E1%86%BC%E1%84%80%E1%85%AE%E1%86%BC%E1%84%89%E1%85%A1.jpg',
        35.1881, 129.2235,
        '해동용궁사는 바다를 배경으로 세워진 아름다운 사찰로, 기도를 위한 장소로 많은 이들이 방문합니다. 경내에는 다양한 조각상과 연못이 있어 조용한 분위기에서 명상을 즐기기 좋습니다.', '부산 기장군 기장읍 용궁길 86 해동용궁사'),
       ('오륙도 스카이워크',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/9e2e8d0f-3a7a-4c6f-aa48-69bfffd6aa9f%E1%84%8B%E1%85%A9%E1%84%85%E1%85%B2%E1%86%A8%E1%84%83%E1%85%A9%20%E1%84%89%E1%85%B3%E1%84%8F%E1%85%A1%E1%84%8B%E1%85%B5%E1%84%8B%E1%85%AF%E1%84%8F%E1%85%B3.jpg',
        35.0972, 129.1263,
        '오륙도 스카이워크는 바다 위에 설치된 투명한 보도로, 아름다운 바다 경관을 감상할 수 있는 명소입니다. 이곳에서 산책하며 바다의 파도 소리와 함께 힐링할 수 있는 경험을 제공합니다.', '부산 남구 오륙도로 137'),
       ('송정해수욕장',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/c1d8ade3-5c87-4b94-a9bf-8d7863897bcd%E1%84%89%E1%85%A9%E1%86%BC%E1%84%8C%E1%85%A5%E1%86%BC%E1%84%92%E1%85%A2%E1%84%89%E1%85%AE%E1%84%8B%E1%85%AD%E1%86%A8%E1%84%8C%E1%85%A1%E1%86%BC.jpeg',
        35.1782, 129.2034,
        '송정해수욕장은 부산에서 유명한 서핑 명소로, 맑고 깨끗한 바다와 아름다운 백사장이 매력적입니다. 여름철에는 다양한 해양 스포츠를 즐길 수 있는 기회가 많아 젊은 관광객들에게 인기입니다.', '부산 해운대구 송정동 712-2'),
       ('장산 등산로',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/317a2bdb-df08-493a-90c0-1cb0836e3560%E1%84%8C%E1%85%A1%E1%86%BC%E1%84%89%E1%85%A1%E1%86%AB%20%E1%84%83%E1%85%B3%E1%86%BC%E1%84%89%E1%85%A1%E1%86%AB%E1%84%85%E1%85%A9.jpg',
        35.1776, 129.1868,
        '장산 등산로는 자연을 만끽하며 트레킹을 즐길 수 있는 장소로, 해안가와 산의 조화를 느낄 수 있습니다. 등산로를 따라 다양한 식물과 동물을 관찰할 수 있어 가족 단위의 관광객들에게도 추천할 만합니다.', '--'),
       ('아미산 전망대',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/aa63075f-b42c-4d48-9a5a-9e95936fe576%E1%84%8B%E1%85%A1%E1%84%86%E1%85%B5%E1%84%89%E1%85%A1%E1%86%AB%20%E1%84%8C%E1%85%A5%E1%86%AB%E1%84%86%E1%85%A1%E1%86%BC%E1%84%83%E1%85%A2.jpeg',
        35.0438, 128.9697,
        '아미산 전망대는 부산 시내와 바다를 한눈에 감상할 수 있는 명소로, 사진 촬영하기에 최적의 장소입니다. 특히 일출과 일몰 때의 경치는 아름다움을 더하며, 많은 관광객들이 찾는 이유 중 하나입니다.', '부산 사하구 다대낙조2길 77'),
       ('다대포 꿈의 낙조분수',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/913a315b-39ed-49db-ae68-f845b39e25b2%E1%84%83%E1%85%A1%E1%84%83%E1%85%A2%E1%84%91%E1%85%A9%20%E1%84%81%E1%85%AE%E1%86%B7%E1%84%8B%E1%85%B4%20%E1%84%82%E1%85%A1%E1%86%A8%E1%84%8C%E1%85%A9%E1%84%87%E1%85%AE%E1%86%AB%E1%84%89%E1%85%AE.JPG',
        35.0442, 128.9673,
        '다대포 꿈의 낙조분수는 부산에서 유명한 낙조를 배경으로 한 분수쇼가 열리는 곳입니다. 분수쇼는 저녁 시간대에 진행되며, 음악과 함께 다양한 물줄기가 어우러져 아름다운 야경을 만들어냅니다.', '부산 사하구 몰운대1길 14'),
       ('국립해양박물관',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/e92399fd-5fa9-4a3e-a34f-fd4f088ce180%E1%84%80%E1%85%AE%E1%86%A8%E1%84%85%E1%85%B5%E1%86%B8%E1%84%92%E1%85%A2%E1%84%8B%E1%85%A3%E1%86%BC%E1%84%87%E1%85%A1%E1%86%A8%E1%84%86%E1%85%AE%E1%86%AF%E1%84%80%E1%85%AA%E1%86%AB.jpg',
        35.0857, 129.0854,
        '국립해양박물관은 해양 문화와 역사, 생태계를 주제로 한 다양한 전시물을 갖춘 박물관입니다. 관람객은 해양에 관한 다양한 지식과 함께 우리 바다의 소중함을 느낄 수 있으며, 어린이와 가족 단위 방문객을 위한 체험 프로그램도 제공됩니다.', '부산 영도구 해양로301번길 45 국립해양박물관'),
       ('누리마루 APEC 하우스',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/bea8307f-0218-44e9-89e0-72815cad02ac%E1%84%82%E1%85%AE%E1%84%85%E1%85%B5%E1%84%86%E1%85%A1%E1%84%85%E1%85%AE%20APEC%20%E1%84%92%E1%85%A1%E1%84%8B%E1%85%AE%E1%84%89%E1%85%B3.jpeg',
        35.1534, 129.1504,
        '누리마루 APEC 하우스는 2005년 APEC 정상회의가 열린 장소로, 현대적인 건축물과 아름다운 경관이 조화를 이루고 있습니다. 내부에는 다양한 회의실과 전시 공간이 마련되어 있으며, 방문객들은 부산의 역사와 문화를 배울 수 있는 기회를 제공합니다.', '부산 해운대구 동백로 116 누리마루APEC하우스'),
       ('부산시립미술관',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/1d05c593-6de5-4852-98a8-dbd28dec1f66%E1%84%87%E1%85%AE%E1%84%89%E1%85%A1%E1%86%AB%E1%84%89%E1%85%B5%E1%84%85%E1%85%B5%E1%86%B8%E1%84%86%E1%85%B5%E1%84%89%E1%85%AE%E1%86%AF%E1%84%80%E1%85%AA%E1%86%AB.jpeg',
        35.1685, 129.1339,
        '부산시립미술관은 다양한 현대 미술 전시를 통해 지역 예술가의 작품을 소개하고, 국내외 작가의 전시도 개최하는 곳입니다. 현대 미술에 대한 이해를 높이고 예술을 즐길 수 있는 공간으로, 미술에 관심 있는 이들에게 특히 추천됩니다.', '부산 해운대구 APEC로 58'),
       ('동백섬',
        'https://hackathon-be-bucket.s3.ap-northeast-2.amazonaws.com/dir/6d0d2f74-b522-46b5-8536-a11372ff1b16%E1%84%83%E1%85%A9%E1%86%BC%E1%84%87%E1%85%A2%E1%86%A8%E1%84%89%E1%85%A5%E1%86%B7.jpg',
        35.1535, 129.1527,
